import React from "react";
export default class Home extends React.Component {
    componentDidMount(){
        fetch("http://localhost:8000/api/home").then(res => res.json()).then((result) => {
            this.setState({
            isLoaded: true,
            data: result
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
      
      console.log(this.state.isLoaded);
      console.log("mounted");
    }
   
    componentDidUpdate(){
        console.log("updated");
    }
    render(){
        return(
            <div></div>
        )
    }
}
